import React from 'react';

import Slide from '../diapo/Slide';

import Img1 from '../../media/img/mern.jpg';
import Img2 from '../../media/img/mern.jpg';
import Img3 from '../../media/img/mern.jpg';


const Images = {Img1, Img2, Img3};

const Main = (props) => {
  return (
    <main className="container row">
      <Slide img={Images} />
    </main>
  )
}

export default Main;
